pragma solidity >=0.5.0 <0.7.0;


contract Curators {

}

contract TradeApprovals {
    string[] public tradeId;
    uint256 count;

    struct Curator {
        address addr;
        int256 validated;
    }

    Curator[] curators;
    Curator[] tempC;

    mapping(string => Curator[]) approval;

    constructor(address[] memory curatorsList) public {
        for (uint256 i = 0; i < curatorsList.length; i++) {
            Curator memory t;
            t.addr = curatorsList[i];
            t.validated = 0;
            curators.push(t);
        }
    }

    function setApprovals(string memory _id) public {
        //approval[_id] = curators;
        uint256 cnt = curators.length;
        //Curator memory c[6];
        Curator[] memory c = new Curator[](cnt);

        for (uint256 i = 0; i < curators.length; i++) {
            Curator memory t;
            t.addr = curators[i].addr;
            t.validated = 0;
            c[i] = t;
            tempC.push(t);
        }

        approval[_id] = tempC;
    }

    function getApproval(string memory _id, address _curAddr)
        public
        view
        returns (int appr)
    {
        for(uint i=0; i<curators.length; i++){
            if(approval[_id][i].addr == _curAddr){
                return approval[_id][i].validated;
            }
        }

    }
}
